import React from 'react';
import {
    Container,
    Form,
    FormGroup,
    Label,
    Input
}from 'reactstrap';

export const Forms=()=>{
    return(
        <Container>
            <Form>
                <FormGroup>
                    <Label>Name</Label>
                    <Input type='text'/>
                    <Label>College</Label>
                    <Input type="text"/>
                </FormGroup>
            </Form>
        </Container>
    )
}
